import React from 'react'

function test() {


 function checkBox()  {
        const checked = document.getElementById("myCheck").checked;
        if (checked) {
         console.log('ok')
        } else {
         console.log('no')
        }
    }

    return (
        <div>
          <input className = 'checkbox'
             type="checkbox"
             id="myCheck"
             onClick={checkBox}/> 
        </div>
    )
}

export default test
